import styled from 'styled-components';
export const Table = styled.table`
  width: 100%;
  border-collapse: collapse;
`;

export const Th = styled.th`
  background-color: #1E90FF;
  color: #fff;
  border: 1px solid #ccc;
  padding: 8px;
`;

export const Td = styled.td`
  border: 1px solid #ccc;
  padding: 8px;
`;
